var initialState = [
    {
        id :1,
        name : 'Iphone 7 plus',
        image : '',
        description : 'Apple',
        price :500,
        inventory : 10
    },
    {
        id :2,
        name : 'Iphone 8 plus',
        image : '',
        description : 'Apple',
        price :700,
        inventory : 50
    },
    {
        id :3,
        name : 'Iphone 9 plus',
        image : '',
        description : 'Apple',
        price :300,
        inventory : 5
    }
];

const product = (state = initialState, action) =>{
    switch(action.type){
        default : return [...state];
    }
}

export default product;
